import React from 'react';
import './App.css';
import {HeaderRow, HeaderTabs, Tab, Layout,Header,Navigation,Content,Drawer,Footer,FooterDropDownSection,FooterLinkList,FooterSection} from 'react-mdl';

function App() {
  return (
      <div style={{height: '300px', position: 'relative'}}>
        <Layout fixedHeader>
          <Header>
            <HeaderRow title="Title" />
            <HeaderTabs ripple activeTab={this.state.activeTab} onChange={(tabId) => this.setState({ activeTab: tabId })}>
              <Tab>Tab1</Tab>
              <Tab>Tab2</Tab>
              <Tab>Tab3</Tab>
              <Tab>Tab4</Tab>
              <Tab>Tab5</Tab>
              <Tab>Tab6</Tab>
            </HeaderTabs>
          </Header>
          <Drawer title="Title" />
          <Content>
            <div className="page-content">Content for the tab: {this.state.activeTab}</div>
          </Content>
        </Layout>
      </div>
  );
}

export default App;
